export function checkWinner (arr = []) {
    const winnerList = [
        [1,2,3],
        [1,4,7],
        [1,5,9],
        [2,5,8],
        [3,6,9],
        [3,5,7],
        [4,5,6],
        [7,8,9]
    ]

    let brr = [...arr]
    brr.sort((a,b)=>{return (a-b)})

    for(let i of winnerList){
        if (JSON.stringify(i) === JSON.stringify(brr)) {
            return true
        }
    }

    return false
}


export function shum (x,y) {
    return x+y
}
